.github-CoAuthorForm {
  display: flex;
  flex-direction: column;
  margin-top: 10px;
  padding: 5px;
  border-radius: 3px 3px 0 0;
  border: 1px solid #1b1d22;
  border-bottom: 0;
  background-color: #373b44;
}
.github-CoAuthorForm-row {
  display: flex;
  align-items: center;
  margin: 5px;
}
.github-CoAuthorForm-row.has-buttons {
  margin: 0;
  flex-wrap: wrap;
}
.github-CoAuthorForm-row.has-buttons .btn {
  flex: 1;
  margin: 5px;
}
.github-CoAuthorForm-row.has-buttons .btn-primary {
  flex: 4;
}
.github-CoAuthorForm-label {
  min-width: 6ch;
}
.github-CoAuthorForm + .github-CommitView-coAuthorEditor {
  margin-top: 0;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
